import {GET_RELATIONSHIPS} from "./types";
import axios from "axios";

const setRelationships = relationships => {
    return {
        type:GET_RELATIONSHIPS,
        payload:relationships
    }
}

export const fetchRelationships = id => dispatch =>{
    axios.get(`/affective/${id}`).then(response => {
        dispatch(setRelationships(response.data))
    }).catch(error=>{
    });
}
